import { Center, Text, VStack, Heading, Box  } from '@chakra-ui/react';
function MyButton() {
    return (
        <Center mt="250px">
            <Stack spacing={4} direction='row' align='center'>
                <Button colorScheme='teal' size='lg'>
                    LOGIN
                </Button>
            </Stack>
        </Center>
    );
}
const Home = (): JSX.Element => (
    <Center mt="160px">
     <VStack spacing="32px">
      <div>
          <Heading>Artists Book</Heading>
          <Text fontSize='4xl'>Manage your favorite artists</Text>
          <MyButton />
      </div>
     </VStack>
    </Center>
);

export default Home;
